import { prependOnceListener } from "process";
import React from "react";

function Fish(props) {
  return (
    <li className="menu-fish">
      <img src={props.details.image} alt={props.details.name} />
      <h3 className="fish-name">{props.details.name}</h3>
    </li>
  );
}

export default Fish;
